import LogoPng from "../../assets/logo/logo.png";
import React from "react";

const Invoice = ({
  data,
  patientData = {},
  total,
  vatPercentage,
  isVatIncluded,
}) => {
  const [totalDiscount, setTotalDiscount] = React.useState(0);
  const [totalPriceWithoutVat, setTotalPriceWithoutVat] = React.useState(0);
  const [totalVatAmount, setTotalVatAmount] = React.useState(0);
  const [subTotal, setSubTotal] = React.useState(0);
  const formatDateString = (str) => {
    const date = new Date(str);
    return `${date.getFullYear()}-${date.getMonth() + 1}-${date.getDate()}`;
  };

  const calculateTotals = () => {
    let totalDiscount = 0;
    let totalWithoutVat = 0;
    let totalVatAmount = 0;
    let totalItemsPrice = 0;
    if (data)
      data.Items.forEach((item, i) => {
        // Calculate total Discount
        totalDiscount += (item.Item?.price * item.discount) / 100;

        // Calculate Sub Total
        totalItemsPrice += item.Item?.price;

        // Calculate total price without vat
        totalWithoutVat +=
          item.Item.price - (item.Item?.price * item.discount) / 100;

        // Calculate Total Vat amount
        totalVatAmount +=
          ((item.Item.price - (item.Item?.price * item.discount) / 100) *
            vatPercentage) /
          100;
      });
    setTotalVatAmount(totalVatAmount);
    setTotalPriceWithoutVat(totalWithoutVat);
    setTotalDiscount(totalDiscount);
    setSubTotal(totalItemsPrice);
  };
  React.useEffect(() => {
    calculateTotals();
  });

  return !data ? (
    ""
  ) : (
    <div className="container">
      <div className="row">
        <div className="col-6">
          <h3 className="">Aloropi Veterinary Center</h3>
          <h6 className="">
            Aloropi Veterinary Center, Maliha Rd - Warehouses Lands - Al Sharjah
          </h6>
          <h6>
            <a className="" href="mailto:clinic@gmail.com">
              aloropi.vet@hotmail.com
            </a>
          </h6>
          <h6 className="">+971 6 5200968 | +971 508987738</h6>
        </div>
        <div className="col-6">
          <h3 className=" text-uppercase text-right font-weight-bold">
            Invoice
          </h3>
          <div className="d-flex justify-content-end">
            <img
              width="120px"
              src="data:image/png;base64,"
              alt="logo"
            />
          </div>
        </div>
      </div>

      <div className="row mt-5">
        <div className="col-4">
          <h6 className=" border-bottom">Billed To</h6>
          <p className=" mb-0">{patientData.address || ""}</p>
          <p className=" mb-0">
            <a className="" href={`mailto:${patientData.email || ""}`}>
              {patientData.email || ""}
            </a>
          </p>
          <p className=" mb-0">{patientData.contact || ""}</p>
        </div>
        <div className="col-8">
          <div className="row d-flex justify-content-end">
            <div className="col-5">
              <div className="row">
                <div className="col-6">
                  <h6 className="text-right">Invoice No :</h6>
                </div>
                <div className="col-6">
                  <p className="text-right mb-0">{`#${data.id}`}</p>
                </div>
              </div>
              <div className="row">
                <div className="col-6">
                  <h6 className="text-right">Invoice Date :</h6>
                </div>
                <div className="col-6">
                  <p className="text-right mb-0">
                    {formatDateString(data.createdAt)}
                  </p>
                </div>
              </div>
              <div className="row">
                <div className="col-6">
                  <h6 className="text-right">Due Date :</h6>
                </div>
                <div className="col-6">
                  <p className="text-right mb-0">
                    {formatDateString(data.createdAt)}
                  </p>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>

      <div className="row mt-5">
        <div className="col-12">
          <table className="table table-bordered table-striped table-sm ">
            <thead>
              <tr>
                <th className="text-center">S.No</th>
                <th className="text-center">Item Name</th>
                <th className="text-center">Unit Price</th>
                <th className="text-center">disc%</th>
                <th className="text-center">Discount Amount (AED)</th>
                <th className="text-center">Amount (Vat Exlusive)</th>
                <th className="text-center">Vat Rate %</th>
                <th className="text-center">Vat Amount (AED)</th>
                <th className="text-center">Total Amount (VAT Inclusive)</th>
              </tr>
            </thead>
            <tbody>
              {data.appointment === "1" && (
                <tr>
                  <td>{"Doctor's Check up"}</td>
                  <td>{"1"}</td>
                  <td>{"Doctor's Fee"}</td>
                  <td>{data.checkUpPrice}</td>
                  <td>--</td>
                  <td>{data.checkUpPrice}</td>
                </tr>
              )}
              {/*  */}
              {(data.Items || []).map((item, i) => {
                return (
                  <tr key={item.Item?.name + "-" + i}>
                    <td className="text-center">{i}</td>
                    <td>{item.Item?.name}</td>
                    <td className="text-center">{item.Item?.price}</td>
                    <td className="text-center">{item.discount}</td>
                    <td className="text-center">
                      {item.discount > 0
                        ? (item.Item?.price * item.discount) / 100
                        : "--"}
                    </td>
                    <td className="text-center">
                      {item.Item.price -
                        (item.Item?.price * item.discount) / 100}
                    </td>
                    <td className="text-center">
                      {isVatIncluded ? <div>{vatPercentage}</div> : "--"}
                    </td>
                    <td className="text-center">
                      {isVatIncluded ? (
                        <div>
                          {((item.Item.price -
                            (item.Item?.price * item.discount) / 100) *
                            vatPercentage) /
                            100}
                        </div>
                      ) : (
                        "--"
                      )}
                    </td>
                    <td className="text-center">
                      {isVatIncluded ? (
                        <div>
                          {item.Item.price -
                            (item.Item?.price * item.discount) / 100 +
                            ((item.Item.price -
                              (item.Item?.price * item.discount) / 100) *
                              vatPercentage) /
                              100}
                        </div>
                      ) : (
                        <div>
                          {item.Item.price -
                            (item.Item?.price * item.discount) / 100}
                        </div>
                      )}
                    </td>
                  </tr>
                );
              })}
              {/*  */}
              {(data.Packages || []).map((item, i) => {
                return (
                  <tr key={item.Package?.name + "-" + i}>
                    <td>{item.Package?.name}</td>
                    <td>{item.quantity}</td>
                    <td>{item.Package?.Service.name}</td>
                    <td>{item.Package?.price}</td>
                    <td>{item?.discount ? item?.discount + "%" : "--"}</td>
                    <td>
                      {((item.Package?.price * (100 - (item?.discount || 0))) /
                        100) *
                        item.quantity}
                    </td>
                  </tr>
                );
              })}
            </tbody>
          </table>
        </div>
      </div>

      <div className="row mt-2">
        <div className="col-4 d-flex justify-content-center align-items-center">
        </div>
        <div className="col-8">
          <div className="row d-flex justify-content-end">
            <div className="col-7">
              <div className="row">
                <div className="col-8">
                  <h6 className="text-right text-uppercase">SubTotal :</h6>
                </div>
                <div className="col-4">
                  <p className="text-right mb-0 border-bottom">{subTotal}</p>
                </div>
              </div>
              <div className="row">
                <div className="col-8">
                  <h6 className="text-right text-uppercase">
                    Discount (AED) :
                  </h6>
                </div>
                <div className="col-4">
                  <p className="text-right mb-0 border-bottom">
                    {totalDiscount}
                  </p>
                </div>
              </div>
              <div className="row">
                <div className="col-8">
                  <h6 className="text-right text-uppercase">Total</h6>
                </div>
                <div className="col-4">
                  <p className="text-right mb-0 border-bottom">
                    {totalPriceWithoutVat}
                  </p>
                </div>
              </div>
              {isVatIncluded && (
                <div className="row">
                  <div className="col-8">
                    <h6 className="text-right text-uppercase">VAT (AED)</h6>
                  </div>
                  <div className="col-4">
                    <p className="text-right mb-0 border-bottom">
                      {totalVatAmount}
                    </p>
                  </div>
                </div>
              )}
            </div>
          </div>
          <div className="row d-flex justify-content-end mt-4">
            <div className="col-7 border-bottom border-top pt-2">
              <div className="row">
                <div className="col-8">
                  <h6 className="text-right text-uppercase">Grand Amount :</h6>
                </div>
                <div className="col-4 pl-0">
                  <h6 className="text-right mb-0">AED {total}</h6>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Invoice;
